import React from 'react';
import Hello from './Hello'; // 引入Hello组件
import './App.css'; // 如果有样式

function App() {
    return (
        <div className="App">
            <h1>Welcome to React + TypeScript!</h1>
            <Hello name="Li" />
            <Hello name="Tom" />
            <Hello name="Jerry" />
        </div>
    );
}

export default App;
